func GetRandomChromeDevice() device.Info {
	r := rand.New(rand.NewSource(time.Now().UnixNano()))
	totalDevices := len(chromeDpDevices)
	randomConst := device.Info(chromeDpDevices[r.Intn(totalDevices)])
	device := randomConst.Device()

	return device
}

